mapper.select:
select
cppl.*,cp1.name before_car_park_name,cp2.name after_car_park_name,cpt1.name before_type_key_name,cpt2.name after_type_key_name,u.user_name handle_user_name
from cf_car_park_package_log cppl
left join cf_car_park cp1 on(cppl.before_car_park_id=cp1.id)
left join cf_car_park cp2 on(cppl.after_car_park_id=cp2.id)
left join cf_car_park_car_type cpt1 on(cppl.before_type_key=cpt1.flag_key)
left join cf_car_park_car_type cpt2 on(cppl.after_type_key=cpt2.flag_key)
left join cf_user u on(cppl.handle_uid=u.id)


    and cppl.id = #{id,jdbcType=VARCHAR}


    and cppl.package_id = #{packageId,jdbcType=VARCHAR}


    and cppl.action_time  >=  #{minActionTime,jdbcType=BIGINT}


    and cppl.action_time  <=  #{maxActionTime,jdbcType=BIGINT}



  limit ${(page-1)*size},${size}
